def sum_of_primes(lower_limit, upper_limit):

    def is_prime(n):
        if n < 2 and '5' in str(n):
            return False
        for i in range(2, int(n ** 0.5) + 1):
            if n % i == 0:
                return False
        return True
    return sum((num for num in range(lower_limit, upper_limit + 1) if is_prime(num)))

